package com.gdlgxy.internshipcommunity.module.internship;import android.os.Bundle;import android.util.Log;import android.view.LayoutInflater;import android.view.View;import android.view.ViewGroup;import com.gdlgxy.internshipcommunity.base.BaseFragment;import com.gdlgxy.internshipcommunity.constant.PageName;import com.gdlgxy.internshipcommunity.databinding.FragmentInternshipBinding;import com.gdlgxy.navannotationmodule.FragmentDestination;import androidx.annotation.NonNull;import androidx.annotation.Nullable;import androidx.lifecycle.Observer;import androidx.lifecycle.ViewModelProvider;@FragmentDestination(pageUrl = "main/module/internship",asStarter = false)public class InternshipFragment extends BaseFragment<FragmentInternshipBinding> {    private InternshipViewModel internshipViewModel=null;    @Override    public void onViewCreated(@NonNull View view, @Nullable Bundle savedInstanceState) {        super.onViewCreated(view, savedInstanceState);        internshipViewModel = new ViewModelProvider(this).get(InternshipViewModel.class);        internshipViewModel.getText().observe(getViewLifecycleOwner(), new Observer<String>() {            @Override            public void onChanged(String s) {                viewBinding.text.setText(s);            }        });        Log.d("fragment-onViewCreated", "InternshipFragment");    }    @Override    public String getPageName() {        return PageName.INTERNSHIP;    }    @Override    public void onDestroyView() {        super.onDestroyView();        internshipViewModel = null;    }    @Override    public FragmentInternshipBinding inflate_Fragment(LayoutInflater layoutInflater, ViewGroup container, boolean at) {        return FragmentInternshipBinding.inflate(layoutInflater,container,false);    }}